import React, { Component } from "react";
import EventsApi from './Events-api'
import './Events.css'

class Events extends Component {
    render() {
        return (
            <div className="events">
                <h2>EVENTS</h2>
                <EventsApi />
            </div>
        );
    }
}

export default Events;
